import React from 'react';
import "./post.css";
import imgPost from "../assets/lavendre.jpg";

export default function Post() {
  return (
    <div className='post'>
        <img
            className='postImg'
            src={imgPost}
            alt=''
        />
        <div className="postInfo">
            <div className="postCats">
                <span className='postCat'>Travel</span>
                <span className='postCat'>Study</span>
            </div>   
            <span className='postTitle'>Lorem ipsum dolor sit amet</span>
            <hr/>
            <span className='postDate'>1 min ago</span>
        </div>
        <p className='postDesc'>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Harum nemo ipsam odio sed rem nostrum, accusamus minus, necessitatibus quibusdam autem repellat dignissimos officiis fugit commodi in eos veniam porro provident.</p>
    
    </div>
  )
}
